// src/components/Button.js

import React from "react";

const Button = ({ onClick, text }) => (
  <button
    onClick={onClick}
    style={{
      backgroundColor: "#3b82f6",
      color: "white",
      padding: "10px 16px",
      borderRadius: "6px",
      border: "none",
      fontSize: "16px",
      cursor: "pointer",
    }}
  >
    {text}
  </button>
);

export default Button;
